btnBack.addEventListener("click", () => {
  checkoutPage.classList.add("hidden");
});

// Finaliza o pedido
checkoutForm.addEventListener("submit", e => {
  e.preventDefault();

  alert("Pedido confirmado! Obrigado pela compra :)");

  cart = [];
  salvarCarrinho();
  atualizarCarrinhoVisual();
  checkoutForm.reset();
  checkoutPage.classList.add("hidden");
});
